        <a className={styles.brand} href=""><img className={styles.logo} src="" alt="" />LOGO</a>
        <ul className={styles.menu}>
          <li className={styles.item}><a className={styles.link} href=""></a></li>
          <li className={styles.item}><a className={styles.link} href=""></a></li>
        </ul>
      </nav>
